USE master
GO

CREATE DATABASE Session3
GO

USE Session3
GO

CREATE TABLE Country (
	CountryId int IDENTITY(1,1) PRIMARY KEY,
	[Name] nvarchar(100) NOT NULL);

CREATE TABLE City (
	CityId int IDENTITY(1,1) PRIMARY KEY,
	[Name] nvarchar(100) NOT NULL,
	CountryId int NOT NULL);

CREATE TABLE Clinic (
	ClinicId int IDENTITY(1,1) PRIMARY KEY,
	[Name] nvarchar(200) NOT NULL,
	ShortName nvarchar(50) NOT NULL,
	ClinicTypeId int NOT NULL,
	[Description] nvarchar(500) NULL,
	OwnerUserId int NOT NULL,
	[Address] nvarchar(50) NOT NULL,
	CityId int NOT NULL);

CREATE TABLE ClinicType (
	ClinicTypeId int IDENTITY(1,1) PRIMARY KEY,
	[Name] nvarchar(50) NOT NULL);

CREATE TABLE [Role] (
	RoleId int IDENTITY(1,1) PRIMARY KEY,
	[Name] nvarchar(50) NOT NULL);

CREATE TABLE [User] (
	UserId int IDENTITY(1,1) PRIMARY KEY,
	FirstName nvarchar(50) NOT NULL,
	LastName nvarchar(50) NOT NULL,
	EMailAddress nvarchar(50) NOT NULL,
	Password nvarchar(50) NOT NULL,
	CreatedDate datetime NOT NULL,
	UpdatedDate datetime NOT NULL,
	AvatarImage varbinary(max) NULL,
	RoleId int NOT NULL);

CREATE TABLE [dbo].[Appointment] (
	[AppointmentId] [int] IDENTITY(1,1) PRIMARY KEY,
	[ClinicId] [int] NOT NULL,
	[PatientId] [int] NOT NULL,
	[DateStart] [datetime] NOT NULL,
	[DateEnd] [datetime] NOT NULL,
	[ServiceInClinicId] [int] NOT NULL,
	[CreatedByAdmin] [bit] NOT NULL,
	[AppointmentStatusId] [int] NOT NULL,
	[StatusChangedDate] [datetime] NOT NULL);

CREATE TABLE [dbo].[AppointmentStatus] (
	[AppointmentStatusId] [int] IDENTITY(1,1) PRIMARY KEY,
	[Name] [nvarchar](50) NOT NULL);

CREATE TABLE [Service] (
	ServiceId int IDENTITY(1,1) PRIMARY KEY,
	[Name] nvarchar(200) NOT NULL,
	ClinicTypeId int NOT NULL);

CREATE TABLE ServiceInClinic (
	ServiceInClinicId int IDENTITY(1,1) PRIMARY KEY,
	ServiceId int NOT NULL,
	ClinicId int NOT NULL,
	Price decimal(10, 2) NOT NULL);

